import React from "react";
import "./Locations.css"
import MenuType from "../components/MenuType.js";
import sh1 from "../images/sh1.jpg";
import sh2 from "../images/sh2.jpg";
import sh3 from "../images/sh3.jpg";
import sh4 from "../images/sh4.jpeg";

function Locations() {

    return (
        <div id="background">
            <h1 id="header">Find A Location Near You</h1>
            <div className="container">
                <div className="row">
                    <MenuType image={sh1} type="SteakHouse1" alt="SteakHouse" />
                    <MenuType image={sh2} type="SteakHouse2" alt="SteakHouse" />
                    <MenuType image={sh3} type="SteakHouse3" alt="SteakHouse" />
                    <MenuType image={sh4} type="SteakHouse4" alt="SteakHouse" />
                </div>
            </div>
        </div>
    )
}

export default Locations;
